  render() {
    return (

      <React.Fragment>
        <NavBar />
        <Layout>
          <Router>
            <Switch>
              <Route> exact path="/" component={ArticlesContainer} </Route>
              {/* <Route> exact path="/about" component={About} </Route> */}
              {/* <Route> component={NoMatch} </Route> */}
            </Switch>
          </Router>
        </Layout>

        {/* <NavigationContainer />
        <ArticlesContainer />
        <FooterContainer /> */}
      </React.Fragment>
    )
  }
};

export default App
